import React from 'react';
import ProjectHeader from '../components/ProjectHeader';
import ProjectDesc from '../components/ProjectDesc';
import ProjectPic from '../components/ProjectPic';
import ProjectPictures from '../components/ProjectPictures';


const Sweep = () => {
    return (
        <>
        <ProjectHeader project="sweep.gg" text="First off, we are gamers. With that said we know that gamers have a need for something more customized than regular social networks. Thats Sweep! A social network for gamers.
But really, another social media platform? Irrelevant posts? Algorithms creating information bubbles? Cyber bullying? Selling user data?
We say no. It’s time for something new. It’s time for users to be in control. It ́s about time gamers get their own social network and connect with integrity.
Welcome to the Good Gaming Community. Let’s Sweep!"></ProjectHeader>
        <ProjectPic src="./sweepimac.png"></ProjectPic>
        <ProjectDesc desc="goal for the project" text="I was asked from the client to design a User Interface for the platform.
        The client presented me with somewhat of a wireframe and a specification of the functionalities to be included. "></ProjectDesc>
        <ProjectPic src="./sweepcafe.png"></ProjectPic>
        <ProjectDesc desc="the process" text="what the heck did you do"></ProjectDesc>
        <ProjectPictures src="./sweepprocess.png"></ProjectPictures>

        </>
    );
}; 

export default Sweep;
